import React from "react";
import Image from "./Image";
import "./ImageGrid.css";

function ImageGrid() {
  return (
    <>
      <div className="row">
        <div className="column">
          <img src="images/img-1.jpg" width="100%" />
          <img src="images/img-2.jpg" width="100%" />
        </div>
        <div className="column">
          <img src="images/img-3.jpg" width="100%" />
          <img src="images/img-4.jpg" width="100%" />
        </div>
        <div className="column">
          <img src="images/img-5.jpg" width="100%" />
          <img src="images/img-6.jpg" width="100%" />
          <img src="images/img-7.jpg" width="100%" />
        </div>
      </div>
    </>
  );
}

export default ImageGrid;
